import React, { Component } from 'react'
import {Timeline, Events, ImageEvent} from '@merc/react-timeline';

export class TimelineElement extends Component {

  render() {
    const {data} = this.props;
    console.log("this is the data",{data})
    const result = Object.values(this.props);
    console.log(result)
    const sortedArray = result.sort((a, b) => b.result.date - a.result.date);
    console.log(sortedArray)
    const lists = sortedArray.map((p) => <li key={p.date}>{p.date}</li>)

    return (
        <div id="timeline">
        <p> test
        {lists}
        </p>
        <Timeline>
          <Events>
          {sortedArray ? sortedArray.map(d =>
            <ImageEvent
            date={d ? d.date : 'loading'}
            text={d ?d.text : 'loading'}
            src={d ?d.src : 'loading'}
            credit={d ?d.textBelow : 'loading'}
            />
          ): 'loading'}
           </Events>
         </Timeline>
   </div>
    )
  }
}

export default TimelineElement
